import React from "react";
import ColorLogo from "../../Assets/Color logo.png";

const SignUp = () => {
  return (
    <div className="d-flex justify-content-center">
      <div
        className="row px-0 w-100"
        style={{ height: "100vh", backgroundColor: "" }}
      >
        <div
          className="mx-0 row col-lg-6 col-md-12 col-sm-12"
          style={{ backgroundColor: "#1687A7", opacity: "50%" }}
        >
          <img
            alt=""
            src={ColorLogo}
            width="100"
            height="120"
            className="d-inline-block align-top"
          />
        </div>
        <div
          className="mx-0 row col-lg-6 col-md-12 col-sm-12"
          style={{ backgroundColor: "#1687A7", opacity: "5%" }}
        >
          SignUp
        </div>
      </div>
    </div>
  );
};

export default SignUp;
